    "diag-note": {                                   "en": "We worked hard to create this project. As equivalent we expect from you some statistics about the usage.<br>No private information will be sent to ioBroker.org. Every time you press update adapter list the anonymized statistics will be sent.<br>Thank you!", "de": "Wir haben hart daran gearbeitet, dieses Projekt auf die Beine zu stellen. Als Gegenleistung bitten wir Sie, uns die Nutzungs-Statistik zu senden.<br>Es werden keine privaten Informationen zu ioBroker.org gesendet. Jedes Mal wenn die Adapterliste aktualisiert wird, wird auch die anonymisierte Statistik verschickt.<br>Vielen Dank!", "ru": "Мы долго работали над этим проектом. Мы просим вас переслать нам статистику использования, как компенсацию.<br>Никакой приватной информации не отсылается в ioBroker.org. Каждый раз, когда список драйверов обновляется, будет отсылаться анонимная статистика.<br>Большое спасибо!", "pt": "Trabalhamos duro para criar este projeto. Em troca, pedimos que nos envie as estatísticas de uso. <br> Nenhuma informação privada será enviada para ioBroker.org. Cada vez que a lista do adaptador é atualizada, as estatísticas anônimas também serão enviadas. <br>Obrigado!", "nl": "We hebben hard gewerkt om dit project te maken. Als equivalent verwachten we van u enkele statistieken over het gebruik. <br> Er zal geen persoonlijke informatie naar ioBroker.org worden verzonden. Telkens wanneer u op de update-adapterlijst klikt, worden de geanonimiseerde statistieken verzonden. <br> Bedankt!", "fr": "Nous avons travaillé dur pour créer ce projet. En tant qu'équivalent, nous attendons de vous des statistiques sur l'utilisation. <br> Aucune information privée ne sera envoyée à ioBroker.org. Chaque fois que vous appuyez sur Mettre à jour la liste des adaptateurs, les statistiques anonymisées seront envoyées. <br> Merci!"},
